angular.module("templates",[]).run(["$templateCache",function(e){e.put("directives/foodEntry.html",'<div class="food-entry__container" ng-mouseleave="showMiddleStep = false; showQuantity = false"><div class="food-entry__frontside flex" ng-click="clicked()" ng-hide="showMiddleStep || showQuantity"><div class="food-entry__info"><span class="food-entry__name">{{name | lowercase}}</span> <span class="food-entry__note">{{note | lowercase | limitTo:10}}</span></div><span class="food-entry__quantity flex flex-center" ng-show="quantity">{{quantity}}</span></div><div class="food-entry__middlestep flex flex-center" ng-show="showMiddleStep"><div class="food-entry__btn flex1" ng-click="onnote(); showMiddleStep = false">NOTE</div><div class="food-entry__btn food-entry__btn--qty flex1" ng-click="showQuantity = true; showMiddleStep = false">QTY</div></div><div class="food-entry__backside flex flex-center" ng-show="showQuantity"><span class="glyphicon glyphicon-minus" ng-click="onminus()"></span> <span class="food-entry__quantity flex flex-center">{{quantity}}</span> <span class="glyphicon glyphicon-plus" ng-click="onplus()"></span></div></div>'),e.put("food.html",'<h1><span class="glyphicon glyphicon-user"></span>Menu</h1><ul class="list-group" ng-controller="FoodCtrl"><li ng-repeat="food in foodList | orderBy: \'name\'" class="list-group-item"><food-entry name="food.name" quantity="appstate.order.getQuantity(food)" onplus="orderFood(food)" onminus="reduceFood(food)"></food-entry></li></ul>'),e.put("new-order.html",'<div ng-controller="NewOrderCtrl"><h1 class="flex flex-align-center"><span class="glyphicon glyphicon-home"></span> <span class="flex1">Nuovo ordine</span><span class="glyphicon glyphicon-ok" ng-click="confirmTables(neworder)"></span></h1><ul class="nav nav-tabs"><li ng-repeat="room in rooms" ng-class="{active: neworder.room == room}" ng-click="neworder.room = room"><a href="#">Room {{room.id}}</a></li></ul><ul class="list-group"><li ng-repeat="table in tables" ng-click="neworder.selectTable(table)" ng-class="{\'selected\': neworder.isSelected(table)}" class="list-group-item flex flex-align-center">Table {{table.id}}</li></ul></div>'),e.put("order.html",'<div class="flex flex-vertical stretch" ng-controller="OrderCtrl"><h1 class="flex flex-align-center"><span class="glyphicon glyphicon-list"></span> <span class="flex1">Order!</span><span class="glyphicon glyphicon-trash" ng-click="removing = true" ng-hide="removing == true"></span> <span class="glyphicon glyphicon-ok" ng-click="removing = false" ng-show="removing == true"></span></h1><ul ng-hide="note.visible" class="list-group flex1"><li ng-repeat="item in orderContent" class="list-group-item"><food-entry name="item.food.name" quantity="item.quantity" note="item.note" onnote="showNote(item)" onplus="orderFood(item)" onminus="reduceFood(item)"></food-entry><div ng-show="removing == true" class="food-remove flex flex-center" ng-click="removeFood(item)">X</div></li></ul><ul ng-show="note.visible" class="list-group flex1"><li class="list-group-item"><food-entry name="note.item.food.name" quantity="note.item.quantity" note="item.note" onplus="orderFood(item)" onminus="reduceFood(item)"></food-entry><div class="save-note flex flex-center" ng-click="note.visible = false; saveNote(note)">Save</div></li><div class="note-container flex flex-center flex-vertical"><span class="note__label">Take a note:</span> <textarea ng-value="note.text" ng-model="note.text"></textarea></div></ul><button class="rmt-button" ng-hide="note.visible" ng-click="sendToKitchen(appstate.order)">Send to kitchen</button></div>'),e.put("sections.html",'<h1><span class="glyphicon glyphicon-user"></span>Menu</h1><ul class="list-group" ng-controller="SectionsCtrl"><li ng-repeat="section in sections | orderBy: section" ng-click="selectSection(section)" class="list-group-item flex flex-align-center">{{section | lowercase}}</li></ul>'),e.put("table-selection.html",'<h1><span class="glyphicon glyphicon-home"></span>Home: ordini attivi</h1><div ng-controller="TablesCtrl"><ul class="nav nav-tabs"><li ng-repeat="room in rooms" ng-class="{active: appstate.room == room}" ng-click="selectRoom(room)"><a href="#">Room {{room.id}}</a></li></ul><ul class="list-group"><li ng-repeat="table in tables | filter:{busy: true}" ng-click="selectTable(table)" class="list-group-item flex flex-align-center">Table {{table.id}}</li></ul></div>')}]);